		"text": "20세기 재즈를 대표하는 재즈 피아니스트 중 하나인 맥코이 타이너가 81세로 사망. 존 콜트레인 쿼텟의 마지막 남은 맴버이기도 한데 개인적으로도 많이 좋아하는 아티스트. 작년 시애틀에서 공연을 할 때 꼭 가보고 싶었는데 못가본게 너무 아쉬움. 고인의 명복을 빕니다 https://t.co/LyXHIYMINS https://t.co/6l3U6lxvSI"
