		"text": "❝ 유한락스를 희석 시켜도 농도를 60~80ppm까지 가능 할 것 같습니다.\n\n예리하게 지적하셨습니다.\n\n해당 기기의 더 큰 한계점은\n질병관리본부는 코로나19의 예방적 살균을 위해 차아염소산나트륨 희석액은 500 ppm 으로 이용하라고 권고했습니다."
