		"lang": "ko",
		"text": "다른 뉴스에 보도된 마스크공장 모습. 위생장갑을 끼고 에어샤워까지 마쳐야 됨. 위 타래 트윗의 뉴스를 보면 기자도 사복 그대로 입장하고 물류 작업하는 기사도 사복을 입고 있음. 이런 면에서 위생상태가 부족한 것 맞는 듯. https://t.co/YGUzyxTYpz\n#마스크 #minfav"
